import { Box, Button, Grid, Paper, TextField } from "@mui/material";
import React from "react";

const login = () => {
  return (
    <div>
      <Grid container sx={{ color: "black" }} spacing={2} top={2}>
        <Grid item md={3} xs={12} height="100px">
          <div>
            Welcome <br /> God to see you
          </div>
        </Grid>
        <Grid item md={3} xs={12}>
          <TextField size="small" sx={{ width: "80%" }}></TextField>
        </Grid>
        <Grid item md={3} xs={12}>
          <TextField size="small" sx={{ width: "80%" }}></TextField>
        </Grid>
        <Grid item md={3} xs={12}>
          <Button variant="contained" sx={{ width: "50%" }}>
            Login
          </Button>
        </Grid>
      </Grid>
    </div>
  );
};

export default login;
